package day1;

public class Program2_Variable {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
   int num=10;
   //int takes only 9 digit value
   System.out.println(num);
   long phonenumber=9865314578199L;
   //long takes any number of value with a suffix 'L' at the end
   System.out.println(phonenumber);
   String name="dimple";
   //string should start with capital letter S
   System.out.println(name);
	}

}
